// src/pages/dashboard/ProfileLayout.js
import React from 'react';
import { Outlet, Link } from 'react-router-dom'; // `Outlet` renders nested routes

// Sidebar component import (ensure Sidebar exists in the components folder)
import Sidebar from '../../components/Sidebar';

const ProfileLayout = () => {
  return (
    <div className="dashboard-layout">
      <Sidebar />  {/* Render Sidebar for navigation */}
      <div className="content">
        <Outlet />  {/* Render the nested routes like UserProfile, OrdersPage, etc. */}
      </div>
    </div>
  );
};

export default ProfileLayout;
